import React, { Component } from "react";

class TempSensor extends Component {
  state = { tempsensor: "" };
  render() {
    return;
    <badge className="badge-primary badge-sm badge-pill m-2">
      {this.props.sensor.value} {this.props.sensor.units}
    </badge>;
  }
}

export default TempSensor;
